  "id_str" : "1099461067418169344",
  "in_reply_to_user_id" : 3119862113,
  "text" : "When you make a lengthy video of comparison, only one thing is made clear: iKON's versatility and duality is like no other. Each song is a different genre and vibe. Even their most hardcore songs sound and incite different kinds of hype. They're that good.",
  "id" : 1099461067418169344,
