  "id_str" : "1099461066260602885",
  "in_reply_to_user_id" : 3119862113,
  "text" : "iKON's stages are never self-centered. What I mean about this is that in all their stages, they make sure to include the audience. So instead of performing FOR the audience, they perform WITH the audience. That difference alone puts iKON's live stages on a pedestal.",
  "id" : 1099461066260602885,
  "in_reply_to_status_id" : 1099461065279102976,
  "created_at" : "2019-02-24 00:08:39 +0000",
