  "id_str" : "1099432505168412673",
  "text" : "I don't get why people compare iKON's live stages w\/ other groups when iKON is suffering from vocal nodules, lack of sleep and a generally packed schedule. I don't get it because iKON still wins regardless of what hurdles they're suffering from prior and during the stage perf. \uD83D\uDC81\u200D\u2640\uFE0F",
